import React from 'react';
import styled,  {css} from 'styled-components';
import img1 from '../../Assets';
import img2 from './image2.png';
import Banner from '../Banner';

const HeroCont = styled.div`${({BgImg})=>css`
height: 967px;
width: 573px;
border-radius: 0px;
background: url(${BgImg});
display: inline-flex;
justify-content: flex-end;
`}`;

const BannerComp = styled.div`
    position: relative;
    top: 65%;   
`;

const Hero = ({BgImg}) => {
    return <HeroCont BgImg={img1}>
        <BannerComp><Banner></Banner></BannerComp>
    </HeroCont>
}

export default Hero;
